  \"2013-03-16T00:47:31.799366\",\n\t\"name\": \"lithology-fault-displacement-and-origin-of-secondary-calcium-carbonate-and-opaline-silica-at-tr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Trenches were excavated in the Yucca Mountain
  region as part of the Yucca Mountain Site Characterization Project. Trench 14, whichnwas
  excavated across the Bow Ridge Fault on the west side of Exile Hill, exposes nearly
  vertical veins containing calcium carbonate, opaline silica, and fine-grained sediments.
  Although the original purpose of the excavation of trench 14 was to evaluatenthe
  nature and frequency of Quaternary movement on the Bow Ridge Fault, concern arose
  as to whether the calcium carbonate-enriched deposits at and adjacent to the fault
  zone were deposited by springs. Spring deposits of Quaternary age would indicate
  that water, in the recent geologic past, had reached the surface from below.\",\n\t\"license_title\":
